import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/navbar";

// Page Components
const Home = () => <h1 className="text-4xl font-bold p-20">Welcome to TravelBook</h1>;
const Destinations = () => <h1 className="text-3xl p-20">Explore Destinations</h1>;
const Services = () => <h1 className="text-3xl p-20">Our Services</h1>;
const Contact = () => <h1 className="text-3xl p-20">Contact Us</h1>;
const Login = () => <h1 className="text-3xl p-20">Login Page</h1>;
const Dashboard = () => <h1 className="text-3xl p-20">Dashboard</h1>;

function App() {
  return (
    <Router>
      <Navbar />
      <div className="pt-20"> {/* padding so content is not hidden behind navbar */}
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/destinations" element={<Destinations />} />
          <Route path="/services" element={<Services />} />
          <Route path="/contact" element={<Contact />} />
          <Route path="/login" element={<Login />} />
          <Route path="/dashboard" element={<Dashboard />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
